import React from "react";

class LoggedTest extends React.Component {
    constructor(props) {
        super(props);
        this.state = {

            user: {}
        }


    }

    componentDidMount(){
        this.setState({user:localStorage.getItem('loggedUser')});
        alert(this.state.user)
    }

    render() {
        return(
            <div className={"text-white"}>
                <p>{this.state.user.userId}</p>
            </div>
        );
    }

}

export default LoggedTest;
